import React from "react";

const Product = (props) => {

    return (
        <div className="todo-item">

            <input
                type="checkbox"
                checked={props.data.completed}
                onChange={() => props.handleChange(props.data.id)}
            />
            <p>{props.data.text}</p>

        </div>
    )
}

export default Product;
